import React from "react";
import CurrentLocation from "./currentLocation";
import "./App.css";

function App() {
  return (
    <React.Fragment>
      <div className="container">
        <CurrentLocation />
        <div style={{ textAlign: "center", padding: "1rem", fontSize: "0.85rem", color: "#888", marginTop: "2rem", fontFamily: "Segoe UI, sans-serif", borderTop: "1px solid #eee" }}>
          © {new Date().getFullYear()} Jidnyesh Chaudhari • <a href="https://github.com/jidnyeshchaudhari" target="_blank" rel="noreferrer" style={{ color: "#0366d6", textDecoration: "none" }}>GitHub</a> • <a href="https://linkedin.com/in/jidnyeshchaudhari" target="_blank" rel="noreferrer" style={{ color: "#0077b5", textDecoration: "none" }}>LinkedIn</a>
        </div>
      </div>
    </React.Fragment>
  );
}

export default App;
